VALUES ('51762629', 'Steaks Thon', 'Thon(Poisson) 70%(Thunnus albacares), sésame 20%, Sauce teriyaqui 10% (huile d\'olive extra vierge 3.6%, eau 3.3%, soja, farine de blé (gluten), sel, amidon de mais modifié, épices). / Zone de pêche : Océan Indien Occidental (Zone FAO N051) / Méthode de pêche : Senne coulissante. Conseils de préparation : Retirer le produit du réfrigérateur 30 minutes avant de le préparer. Enlever l\'emballage. Mettre un peu d\'huile dans une poêle et cuire à feu moyen pendant 3/4 minutes de chaque côté. Cuire à son goût, sans trop brûler le sésame. Toujours cuire le produit avant de le consommer.LPoids net : 250G / A consommer de préférence avant le : 15%6/2018 NO lot : 170406 / Conservation à? 18 oc / Ne jamais recongeler un produit décongelé Energie 758 kJ/ 182 Kcal; Lipides 7.8g; Dont acides gras saturés 2g; Glucides 0.4g; Dont sucres 0. lg; Protéines 26.9g; Sel 1.54g. LUMAR SEAFOOD INTERNATIONAL SL - AVDR A TOMADA, 18-19, 15940 - POBRA DO CARAMINAL A CORUNA- ESPAGNE,,,', '', '7.8', '2', '0.4', '0.1', '', '26.9', '1.54', '0.606299212598425', '', '0');

